import React from 'react'
import stack_overflow_icon from '../stack_overflow_icon.png'
import { MdMenu } from 'react-icons/md';
import { FaUserCircle } from 'react-icons/fa';
import { FaSearch } from 'react-icons/fa';
import { Link } from 'react-router-dom';


export default function Welcome() {
  return (
    <div className='bg-stone-500 flex items-center justify-between'>
      <div className='flex items-center w-full px-2'>
      <MdMenu size={30} className='text-white'/>
      <img src={stack_overflow_icon} alt="StackOverflow Icon" width={50}/>
      <input type="text" className='hidden sm:block w-2/3 rounded-sm' placeholder='Paste here :'/>
      </div>

      <div className='flex items-center px-2'>
      <FaSearch size={30} className='text-white'/>
      <FaUserCircle size={35} className='text-white'/>
      </div>
    </div>
  )
}
